css:
@namespace url(http://www.w3.org/1999/xhtml);

@-moz-document domain("docs.racket-lang.org") {
  body {
    background-color: black;
    color: lime;
  }
  .RktVar {
    color: green;
  }
  .RktRes {
    color: maroon;
  }
  .boxed, blockquote.SVInsetFlow, .SVInsetFlow, .SVInsetFlow tbody, .defmodule, .hide_when_on_the_web .refcolumn {
    background: #353535 !important;
    lighting-color: #353535 !important;
    background-color: #353535 !important;
    color: #00cc00 !important;
    border-top: none;
  }
  .hide_when_on_the_web .refcolumn {
    border: none;
  }
  .SVInsetFlow .RBackgroundLabelInner {
    color: lime;
  }
  .SVInsetFlow a, .SVInsetFlow .RktValLink {
    color: green !important;
  }
  .SVInsetFlow .RktVar {
    color: #ccc;
  }
  .tocset {
    background-color: #353535;
  }
  a:link, a:visited, .RktValLink, .RktStxLink {
    color:#4183C4 !important;
  }
  h1,h2,h3,h4,h5,h6 {
    color: green;
  }
  .searchbox {
    background-color: #666;
    color: white;
    border: none;
  }
}
